import SWdata from '../data/SWdata';

export default function Planetas(planet) {
  const planetData = () => SWdata.map((el) => (el.name === planet.planet) ? console.log(el) : null);
console.log(planetData);
  return (
      <p>{planetData.name}</p>
  )
};
